import { Typography } from '@mui/material';
import { Box } from '@mui/system';
import { Link } from 'react-router-dom';
import './App.css';

import Nav from './components/Nav/Nav';

function App() {
  return (
    // <Routes>
    <div>
      <Nav />
      <Box
        sx={{
          display: "flex",
          justifyContent: "center",
          marginTop: '8px'
        }}>
        <Typography variant='h2' color='primary'>Welcome to Home Screen</Typography>
        </Box>
      >
    </div>
    // </Routes>
  );
}

export default App;
